INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (106001, 0, "たまには\n協力するのもいいんじゃない？\nあたしも手を貸してあげる", 7, 1, "2030/12/17 14:59:59", 7001, -363.0, "キャル", 1, 0.0, 1, "2015/12/17 15:00:00", 0, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (105901, 0, "多くの方と協力して\n戦えるようです\n主さまなら、さぞ\nご活躍なさることでしょう", 7, 1, "2030/12/17 14:59:59", 7002, -363.0, "コッコロ", 1, 0.0, 1, "2015/12/17 15:00:00", 0, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (105801, 0, "たくさんの人と一緒に\n協力バトルです！\nがんばりましょう☆", 7, 1, "2030/12/17 14:59:59", 7003, -363.0, "ペコリーヌ", 1, 0.0, 1, "2015/12/17 15:00:00", 0, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (105801, 0, "ジュエルを食べ物…\nいえ、貴重品と交換できます！", 10, 1, "2030/12/17 14:59:59", 10001, -363.0, "ペコリーヌ", 1, 0.0, 1, "2015/12/17 15:00:00", 0, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (106001, 0, "ジュエルはよく考えて\n使うことね\n無駄遣い厳禁！", 10, 1, "2030/12/17 14:59:59", 10002, -363.0, "キャル", 1, 0.0, 1, "2015/12/17 15:00:00", 0, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (105901, 0, "主さまのジュエルで\n貴重な品々を購入できます\nですが、無駄遣いは\n『めっ』でございますよ", 10, 1, "2030/12/17 14:59:59", 10003, -363.0, "コッコロ", 1, 0.0, 1, "2015/12/17 15:00:00", 0, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (106401, 2104010, "ジュエルがあれば\n貴重品と交換できるみたい\n大事に使いましょうね", 10, 1, "2030/12/17 14:59:59", 10004, -363.0, "シェフィ", 2, 0.0, 1, "2015/12/17 15:00:00", 0, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (105801, 0, "特定の条件を達成すると\n報酬がもらえますよ！\nがんばりましょう♪　", 12, 1, "2030/12/17 14:59:59", 12001, -416.5, "ペコリーヌ", 1, 0.0, 1, "2015/12/17 15:00:00", 0, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (106001, 0, "思い出が詰まってるって\nいろいろあったけど\n振り返るのもいいんじゃない？", 13, 1, "2030/12/17 14:59:59", 13001, -363.0, "キャル", 1, 0.0, 1, "2015/12/17 15:00:00", 0, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (105901, 0, "主さまとの楽しい日々…\nこちらで何度でも\n思い返しましょう♪", 13, 1, "2030/12/17 14:59:59", 13002, -363.0, "コッコロ", 1, 0.0, 1, "2015/12/17 15:00:00", 0, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (106401, 2104010, "みんなとの大切な思い出が\nたくさん詰まってるのね\n一緒に振り返って、\n心に刻みたいわ", 13, 1, "2030/12/17 14:59:59", 13003, -363.0, "シェフィ", 2, 0.0, 1, "2015/12/17 15:00:00", 0, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (105801, 0, "女の子との思い出が\nたくさん見られますよ！\nヒューヒュー♪\nモテモテですねー☆", 13, 1, "2030/12/17 14:59:59", 13004, -363.0, "ペコリーヌ", 1, 0.0, 1, "2015/12/17 15:00:00", 0, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (105901, 0, "育成に必要なアイテムが\n獲得できるクエストです\nわたくし、主さまのために、\n強くなりますよ", 14, 1, "2030/12/17 14:59:59", 14001, -363.0, "コッコロ", 1, 0.0, 1, "2015/12/17 15:00:00", 0, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (106401, 2104010, "このクエストを攻略すると、\nアイテムが手に入るらしいわ。\nもっと強くなるために、\n一生懸命がんばるわね！", 14, 1, "2030/12/17 14:59:59", 14002, -363.0, "シェフィ", 2, 0.0, 1, "2015/12/17 15:00:00", 0, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (105801, 0, "このクエストを攻略すれば、\nアイテムがもらえますよ\nたくさん集めて、どんどん\n強くなっちゃいましょう！", 14, 1, "2030/12/17 14:59:59", 14003, -363.0, "ペコリーヌ", 1, 0.0, 1, "2015/12/17 15:00:00", 0, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (106001, 0, "クエストを攻略すると、\nアイテムが手に入るんだって\nもらえるものは、\nもらっておきましょ！", 14, 1, "2030/12/17 14:59:59", 14004, -363.0, "キャル", 1, 0.0, 1, "2015/12/17 15:00:00", 0, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (105901, 0, "主さま、旅の準備を整えて\nより充実した冒険をいたし\nましょう", 15, 1, "2030/12/17 14:59:59", 15001, -470.0, "コッコロ", 1, 0.0, 1, "2015/12/17 15:00:00", 0, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (106401, 2104010, "ねぇ…クランに加入してみない？\n一人も楽しいけど、みんなと\n一緒も賑やかでいいと思うの", 16, 1, "2030/12/17 14:59:59", 16001, -363.0, "シェフィ", 2, 0.0, 1, "2015/12/17 15:00:00", 0, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (105801, 0, "クランに加入してみませんか？\nみんなといっしょに冒険した方が、\n楽しいですよ！", 16, 1, "2030/12/17 14:59:59", 16002, -363.0, "ペコリーヌ", 1, 0.0, 1, "2015/12/17 15:00:00", 0, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (106001, 0, "クランに入れるらしいわよ\nせっかくだから入ってみたら？\nけっこう楽しいみたいよ♪", 16, 1, "2030/12/17 14:59:59", 16003, -363.0, "キャル", 1, 0.0, 1, "2015/12/17 15:00:00", 0, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (105901, 0, "こちらでクランに加入できます\n素敵なクランがたくさんあって、\n目移りしてしまいますね", 16, 1, "2030/12/17 14:59:59", 16004, -363.0, "コッコロ", 1, 0.0, 1, "2015/12/17 15:00:00", 0, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (105901, 0, " こちらではクランバトルに\n 参加された仲間のみなさんの\n 活躍を振り返ることができます", 17, 1, "2030/12/17 14:59:59", 17002, -363.0, "コッコロ", 1, 0.0, 1, "2015/12/17 15:00:00", 0, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (106001, 0, "模擬戦の戦績もアンタが\n気に入ったものがあれば\n記録しておけるのね", 25, 1, "2030/12/17 14:59:59", 17004, -363.0, "キャル", 1, 0.0, 1, "2015/12/17 15:00:00", 0, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (105901, 0, "主さま、今回のクランバトルでの\nご活躍が記録されています\nバトルの参考にいたしましょう", 25, 1, "2030/12/17 14:59:59", 17005, -363.0, "コッコロ", 1, 0.0, 1, "2015/12/17 15:00:00", 0, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (106401, 2104010, "今回のクランバトルの調子は\nどうかしら？\n戦績を見れば、次のバトルに\n活かせるかもしれないわ", 25, 1, "2030/12/17 14:59:59", 17006, -363.0, "シェフィ", 2, 0.0, 1, "2015/12/17 15:00:00", 0, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (105801, 0, "今回のクランバトルでの戦績を\nおさらいできますよ！\n私にも見せてください☆", 25, 1, "2030/12/17 14:59:59", 17007, -363.0, "ペコリーヌ", 1, 0.0, 1, "2015/12/17 15:00:00", 0, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (190801, 0, "ようこそ！\nこちらでは、\nギルドハウスで流れる音楽の\n変更や購入が出来ますよ", 18, 1, "2030/12/17 14:59:59", 18001, -363.0, "カリン", 1, 0.0, 1, "2015/12/17 15:00:00", 0, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (190801, 0, "ＢＧＭの変更や購入は、こちらから\nできますよ\n素敵な音楽を、たくさんご用意\nいたしました！", 18, 2, "2030/12/17 14:59:59", 18002, -363.0, "カリン", 1, 0.0, 1, "2015/12/17 15:00:00", 0, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (190801, 0, "ギルドハウスの\nＢＧＭを変更できますよ\nあなたの好きな曲、\n私にも聴かせてくださいね", 19, 3, "2030/12/17 14:59:59", 19001, -470.0, "カリン", 1, 0.0, 1, "2015/12/17 15:00:00", 0, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (190801, 0, "こちらでは、ＢＧＭの変更が\nできますよ\nどんな曲に変更しますか？\nふふふ、私も楽しみです♪", 19, 4, "2030/12/17 14:59:59", 19002, -470.0, "カリン", 1, 0.0, 1, "2015/12/17 15:00:00", 0, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (190801, 0, "こちらでは、ＢＧＭを購入\nすることができますよ\n試聴することもできるので、\nじっくり選んでくださいね", 20, 5, "2030/12/17 14:59:59", 20001, -470.0, "カリン", 1, 0.0, 1, "2015/12/17 15:00:00", 0, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (190801, 0, "いらっしゃいませ！\nＢＧＭの購入はこちらです\n素敵な曲がたくさんあって、\n目移りしちゃいますね", 20, 6, "2030/12/17 14:59:59", 20002, -470.0, "カリン", 1, 0.0, 1, "2015/12/17 15:00:00", 0, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (106001, 0, "ここで手に入れたアイテムで\n専用装備を作成できるみたいね\nアイテムが集まったら\nさっそく作ってみましょ！", 21, 1, "2030/12/17 14:59:59", 21001, -363.0, "キャル", 1, 0.0, 1, "2015/12/17 15:00:00", 0, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (105901, 0, "攻略すると珍しいアイテムが\n手に入りますよ\nこのアイテムで専用装備を\n作成できるようです", 21, 1, "2030/12/17 14:59:59", 21002, -363.0, "コッコロ", 1, 0.0, 1, "2015/12/17 15:00:00", 0, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (106401, 2104010, "専用装備が欲しいなら\nこのクエストに挑戦するといいわ\n集めた素材でもっともっと\n強くなりましょう", 21, 1, "2030/12/17 14:59:59", 21003, -363.0, "シェフィ", 2, 0.0, 1, "2015/12/17 15:00:00", 0, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (105801, 0, "専用装備の作成に必要な\nアイテムを獲得できますよ\nたくさん集めてどんどん\n強くなりましょう！", 21, 1, "2030/12/17 14:59:59", 21004, -363.0, "ペコリーヌ", 1, 0.0, 1, "2015/12/17 15:00:00", 0, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (190801, 0, "投票はこちらです\nあなたが応援したい女の子に\n思いを込めた一票を\nお願いします！", 22, 1, "2030/12/17 14:59:59", 22001, -430.0, "カリン", 1, 0.0, 1, "2015/12/17 15:00:00", 0, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (190801, 0, "ようこそ！\nあなたが思いを寄せるのは\nどの女の子ですか？\n応援してあげてくださいね！", 22, 2, "2030/12/17 14:59:59", 22002, -430.0, "カリン", 1, 0.0, 1, "2015/12/17 15:00:00", 0, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (190801, 0, "たくさんの投票、\nありがとうございました\n結果発表を楽しみに\n待っていてくださいね！", 23, 3, "2030/12/17 14:59:59", 23001, -430.0, "カリン", 1, 0.0, 1, "2015/12/17 15:00:00", 0, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (190801, 0, "ただ今、人気投票の\n集計中です\n結果が出るまでもう少しだけ\nお待ちくださいね", 23, 4, "2030/12/17 14:59:59", 23002, -430.0, "カリン", 1, 0.0, 1, "2015/12/17 15:00:00", 0, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (109001, 0, "あなた様が手伝ってくださった\nチョコレートケーキ\n美味しくないはずがありませんわ", 24, 1, "2030/12/17 14:59:59", 24001, -385.0, "エリコ（バレンタイン）", 1, 4.08, 2, "2019/01/31 12:00:00", 10011, 8.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (109001, 0, "このような失敗、あなた様が\nするはずありません\nもう一度挑戦してみましょう", 24, 2, "2030/12/17 14:59:59", 24002, -385.0, "エリコ（バレンタイン）", 1, 5.0, 2, "2019/01/31 12:00:00", 10011, 8.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (109001, 0, "あなた様のために\n作っているケーキを\nあなた様に手伝っていただく……\nことになるなんて……クスクス", 24, 3, "2030/12/17 14:59:59", 24003, -385.0, "エリコ（バレンタイン）", 1, 10.11, 2, "2019/01/31 12:00:00", 10011, 8.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (109001, 0, "あまり気に病む必要はありませんわ\nこれからは私がたっぷりと\n時間をかけて教えて差し上げますから", 24, 4, "2030/12/17 14:59:59", 24004, -385.0, "エリコ（バレンタイン）", 1, 4.0, 2, "2019/01/31 12:00:00", 10011, 8.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (109001, 0, "今回は調子が悪かった……のですか？\nあなた様が手伝ってくれたものなら\nわたしはどんなものでも……クスクス", 24, 5, "2030/12/17 14:59:59", 24005, -385.0, "エリコ（バレンタイン）", 1, 6.0, 2, "2019/01/31 12:00:00", 10011, 8.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (109002, 0, "あなた様が手がけた\nチョコレートケーキは\n私にとっての宝物……\n侮辱する者は生かしておきませんわ", 24, 6, "2030/12/17 14:59:59", 24006, 0.0, "エリコ（バレンタイン）", 1, 0.0, 1, "2019/01/31 12:00:00", 10011, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (109002, 0, "とても素晴らしい出来栄えですわ！\nあなた様にふさわしい\nチョコレートケーキができました", 24, 7, "2030/12/17 14:59:59", 24007, 0.0, "エリコ（バレンタイン）", 1, 0.0, 1, "2019/01/31 12:00:00", 10011, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (109002, 0, "私を手伝ってくれたあなた様は\nすでに私の虜……\n甘い世界に誘って差し上げますわ", 24, 8, "2030/12/17 14:59:59", 24008, 0.0, "エリコ（バレンタイン）", 1, 0.0, 1, "2019/01/31 12:00:00", 10011, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (109002, 0, "あなた様の愛情\nしかと受け止めました\nこれが……私たちの初めての\n共同作業ですわね……クスクス", 24, 9, "2030/12/17 14:59:59", 24009, 0.0, "エリコ（バレンタイン）", 1, 0.0, 1, "2019/01/31 12:00:00", 10011, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (109002, 0, "これは世界一の\nチョコレートケーキですわ\nだって、あなた様が腕によりをかけて\n作ってくださったんですもの", 24, 10, "2030/12/17 14:59:59", 24010, 0.0, "エリコ（バレンタイン）", 1, 0.0, 1, "2019/01/31 12:00:00", 10011, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (109101, 0, "上手にできなくて残念だった？\nでも、弟くんの気持ちが嬉しいな\nいつだってお姉ちゃんは\nそばにいるからね♪", 24, 1, "2030/12/17 14:59:59", 24011, -385.0, "シズル（バレンタイン）", 1, 2.12, 2, "2019/01/31 12:00:00", 10011, 8.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (109101, 0, "うーん、弟くんには珍しく\n緊張しちゃったのかな？\nもう一度チャレンジしてみる？", 24, 2, "2030/12/17 14:59:59", 24012, -385.0, "シズル（バレンタイン）", 5, 4.19, 2, "2019/01/31 12:00:00", 10011, 8.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (109101, 0, "お姉ちゃんのお手伝い、\nよくできました！\nあー、\nまだつまみ食いしちゃダメだぞ！", 24, 3, "2030/12/17 14:59:59", 24013, -385.0, "シズル（バレンタイン）", 2, 2.3, 4, "2019/01/31 12:00:00", 10011, 8.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (109102, 0, "見てみて！\nスポンジに綺麗な焼き目がついてるよ\nさっすが弟くんだね！", 24, 4, "2030/12/17 14:59:59", 24014, 0.0, "シズル（バレンタイン）", 1, 0.0, 1, "2019/01/31 12:00:00", 10011, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (109101, 0, "まぁまぁ、落ち込まないで\n見た目は……個性的だけど、\n味は絶対美味しいはずだから！", 24, 5, "2030/12/17 14:59:59", 24015, -385.0, "シズル（バレンタイン）", 5, 5.23, 2, "2019/01/31 12:00:00", 10011, 8.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (109102, 0, "弟くんみたいな\n可愛いケーキができたよ！\n早く食べてみたいでしょ♪", 24, 6, "2030/12/17 14:59:59", 24016, 0.0, "シズル（バレンタイン）", 1, 0.0, 1, "2019/01/31 12:00:00", 10011, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (109101, 0, "あれれ？　弟くん、指に\nチョコレートがくっついてるよ？\nお姉ちゃんが舐めてあげるね、\nはぁむ！", 24, 7, "2030/12/17 14:59:59", 24017, -385.0, "シズル（バレンタイン）", 1, 5.01, 2, "2019/01/31 12:00:00", 10011, 8.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (109102, 0, "なかなか上手にできたんじゃない？\nでも弟くんはまだまだできる子！\nお姉ちゃん、信じてるからね", 24, 8, "2030/12/17 14:59:59", 24018, 0.0, "シズル（バレンタイン）", 1, 0.0, 1, "2019/01/31 12:00:00", 10011, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (109102, 0, "わぁ～、\nとっても美味しそうにできたね！\n弟くん手慣れてたから\nお姉ちゃん安心して任せられちゃった！", 24, 9, "2030/12/17 14:59:59", 24019, 0.0, "シズル（バレンタイン）", 1, 0.0, 1, "2019/01/31 12:00:00", 10011, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (109102, 0, "や～ん、弟くんが手伝ってくれた\nチョコレートケーキ！\nすっごく美味しそうにできたね♪", 24, 10, "2030/12/17 14:59:59", 24020, 0.0, "シズル（バレンタイン）", 1, 0.0, 1, "2019/01/31 12:00:00", 10011, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (106401, 2104010, "ここから先は神聖な場所みたい\nどんなお宝が眠っているのか、\n今から探索するのが楽しみね♪", 26, 1, "2030/12/17 14:59:59", 26001, -363.0, "シェフィ", 2, 0.0, 1, "2015/12/17 15:00:00", 0, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (105801, 0, "ここから先は神聖な場所\nみたいです！\nどんなお宝が手に入るか\n楽しみですね！", 26, 1, "2030/12/17 14:59:59", 26002, -363.0, "ペコリーヌ", 1, 0.0, 1, "2015/12/17 15:00:00", 0, 0.0);
