INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (106401, 2104010, "ここでは腕試しが\nできるんですって。\n自分の実力を測るのに、\nちょうどよさそうね。", 41, 1, "2030/12/17 14:59:59", 41001, -363.0, "シェフィ", 1, 0.0, 1, "2015/12/17 15:00:00", 0, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (105801, 0, "ここで腕試しを\nしていきましょう！\n全力全開、\nがんばっちゃいますよ～！", 41, 1, "2030/12/17 14:59:59", 41002, -363.0, "ペコリーヌ", 1, 0.0, 1, "2015/12/17 15:00:00", 0, 0.0);
