INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (105901, 0, "訓練の成果に応じて、\n報酬がもらえるそうです。\n共に励んでいきましょう。", 42, 1, "2030/12/17 14:59:59", 42001, -416.5, "コッコロ", 1, 0.0, 1, "2015/12/17 15:00:00", 0, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (106401, 2104010, "目標を達成すれば、\n報酬がもらえるみたい。\n頑張り甲斐があるわね。", 42, 1, "2030/12/17 14:59:59", 42002, -416.5, "シェフィ", 1, 0.0, 1, "2015/12/17 15:00:00", 0, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (105801, 0, "腕試しをがんばれば、\n報酬がもらえますよ。\n挑戦していきましょう☆", 42, 1, "2030/12/17 14:59:59", 42003, -416.5, "ペコリーヌ", 1, 0.0, 1, "2015/12/17 15:00:00", 0, 0.0);
