INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (105801, 0, "ここからアリーナに\n挑戦できますよ！\n編成を工夫してライバルに\n挑んじゃいましょう！", 43, 1, "2030/12/17 14:59:59", 43001, -363.0, "ペコリーヌ", 1, 0.0, 1, "2015/12/17 15:00:00", 0, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (105901, 0, "こちらからアリーナに\n挑戦することができます。\n主さまらしい編成で\nライバルに挑みましょう。", 43, 1, "2030/12/17 14:59:59", 43002, -363.0, "コッコロ", 1, 0.0, 1, "2015/12/17 15:00:00", 0, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (106001, 0, "ここからアリーナに\n挑戦できるわよ！\nしっかり編成を考えて\nライバルに挑みなさい！", 43, 1, "2030/12/17 14:59:59", 43003, -363.0, "キャル", 1, 0.0, 1, "2015/12/17 15:00:00", 0, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (123001, 0, "ミッションをクリアすると報酬が\n受け取れるわ。ジャンジャン\nクリアしてバリバリ強化して\nあげなさい♪", 44, 1, "2030/12/17 14:59:59", 43004, -416.5, "アメス", 1, 0.0, 1, "2015/12/17 15:00:00", 0, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (123001, 0, "ぼんやりしてる場合じゃないわ。\n早くミッションをクリアして\n報酬を受け取ってきなさい！", 44, 2, "2030/12/17 14:59:59", 43005, -416.5, "アメス", 1, 0.0, 1, "2015/12/17 15:00:00", 0, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (123001, 0, "ちょっとあんた、報酬が\n受け取れるじゃない！\n忘れずにチェックなさい。\nアメス様との約束よ？", 45, 3, "2030/12/17 14:59:59", 43006, -416.5, "アメス", 1, 5.79, 2, "2015/12/17 15:00:00", 0, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (123001, 0, "はい、お疲れさま。\nここではマスタリーチケットを\n使って、マスタリー強化素材を\n手に入れることができるわよ。", 46, 1, "2030/12/17 14:59:59", 46001, -371.5, "アメス", 1, 0.0, 1, "2015/12/17 15:00:00", 0, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (104901, 0, "呼ばれて飛び出てお姉ちゃんだよ♪\nたとえ火の中、水の中、迷宮の中っ\nこのダンジョンを踏破できるよう\n弟くんを応援してあげるからねっ♪", 47, 1, "2030/12/17 14:59:59", 47001, -416.5, "シズル", 2, 0.0, 2, "2015/12/17 15:00:00", 0, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (101101, 0, "ほんとーに不思議な場所ですね～\nお兄ちゃんが冒険を頑張れるよう\nおまじないをかけてあげますねっ\nフレーフレー、お・兄・ちゃんっ♪", 47, 1, "2030/12/17 14:59:59", 47002, -416.5, "リノ", 1, 9.32, 2, "2015/12/17 15:00:00", 0, 0.0);
